(3292, 'frFR', 'Savoir infini', 'Une essence de savoir amalgamée provenant d\’une autre ligne temporelle. Le savoir infini augmente la quantité de pouvoir infini que vous octroient la plupart des sources. Au-delà de sa limite, tout savoir infini obtenu est automatiquement converti en bronze.', 63906),
(3008, 'frFR', 'Pierres de vaillance', 'Obtenues en accomplissant des quêtes, des raids, des donjons, des champs de bataille, des matchs d\’arène, des échos radieux et d\’autres activités au niveau maximum. Utilisées pour améliorer l\’équipement de niveau maximum.', 63906);
