(2683, 'frFR', 'Cheval d\’os de l\’oubli', '|cFFFFD200Évènement mondial :|r WoW Remix: Legion', 'Un bon destrier est fidèle jusqu\’aux os. Ayant abandonné son enveloppe charnelle, cette monture est un symbole de modicité et d\’agonie.', 63906),
