(2681, 'frFR', 'Cheval d\’os du carnage', '|cFFFFD200Évènement mondial :|r WoW Remix: Legion', 'Un bon destrier est fidèle jusqu\’aux os. Ayant abandonné son enveloppe charnelle, cette monture est un symbole de conflit éternel.', 63906),
(2679, 'frFR', 'Cheval d\’os du triomphe', '|cFFFFD200Évènement mondial :|r WoW Remix: Legion', 'Un bon destrier est fidèle jusqu\’aux os. Ayant abandonné son enveloppe charnelle, cette monture est un symbole de valeureuse conquête.', 63906),
(2732, 'frFR', 'Chasseur-phasique cobalt', '|cFFFFD200Promotion :|r Burning Crusade Classic', 'Grâce aux énergies occultes ayant irradié Draenor, ces créatures insaisissables sont capables de passer d\’un plan à l\’autre. Il est donc rare de les voir arriver… jusqu\’à ce que ce soit trop tard.', 63906),
(2640, 'frFR', 'Bombardier des Brasseurs', '|cFFFFD200Butin :|r Coren Navrebière|n|cFFFFD200Évènement saisonnier :|r fête des Brasseurs', 'Attention à ne pas boire les munitions.', 63906),
(2566, 'frFR', 'Cascade cramoisie de Lana\’thel', '|cFFFFD200Boutique en jeu|r ', 'La maîtrise des arts sanguins de la reine de sang lui a permis d\’invoquer un terrifiant serviteur à chevaucher au combat. Bardé de la livrée de sa cour, il est masqué d\’un visage terrifiant et paré d\’ailes et de griffes pour évoquer le courroux de sa maîtresse.', 63906);
