INSERT INTO `ui_splash_screen_locale` (`ID`, `locale`, `Header_lang`, `TopLeftFeatureTitle_lang`, `TopLeftFeatureDesc_lang`, `BottomLeftFeatureTitle_lang`, `BottomLeftFeatureDesc_lang`, `RightFeatureTitle_lang`, `RightFeatureDesc_lang`, `VerifiedBuild`) VALUES
(85, 'frFR', 'Nouveautés de la mise à jour 11.2.0 !', 'Succession écologique', 'Aidez Ve\’nari en réunissant des créatures de tout Azeroth afin de restaurer la vie sur K\’aresh.', 'Écodôme Al\’dani', 'Défendez l\’écodôme caché et découvrez les secrets antiques qui y sont enfouis !', 'K\’aresh', 'Découvrez les sombres secrets du Vide sur la planète perdue des Éthériens.', 63906),
(84, 'frFR', 'Nouveautés de la mise à jour 11.1.7 !', 'Chroniques', 'Parlez au chroniqueur Cho dans une capitale pour vivre une nouvelle expérience de quête dans des moments emblématiques de l\’histoire d\’Azeroth !', 'Assistant de combat', 'Recevez un coup de pouce avec vos rotations de combat en activant cette fonction dans les paramètres !', 'Gouffres : surchargés !', 'Alimentez les machines des Titans pour explorer de nouvelles profondeurs et relever de nouveaux défis.', 63906),
(80, 'frFR', 'Nouveautés de la mise à jour 11.1.5 !', 'Gestionnaire de temps de recharge', 'Suivez vos temps de recharge en activant cette fonction dans les paramètres !', 'Prochainement : Duos infâmes', 'Combattez un duo d\’adversaires du passé d\’Azeroth et tentez d\’obtenir le meilleur score !', 'Visions horrifiques redécouvertes', 'Repartez aux tréfonds de la folie pour relever de nouveaux défis et obtenir de nouvelles récompenses !', 63906),
(76, 'frFR', 'Nouveautés de la mise à jour 11.1.0 !', 'V.R.O.U.M.', 'Découvrez une nouvelle façon de vous déplacer dans Terremine avec le G-99 Ventraterre personnalisable !', 'Personnalisez votre campement', 'Créez de nouveaux camps à l\’écran de sélection des personnages et choisissez parmi un éventail de fonds à débloquer !', 'Terremine', 'Continuez de poursuivre Xal\’atath et affrontez les forces de Gallywix dans les vastes rues de Terremine.', 63906),
(73, 'frFR', 'Nouveautés de la saison 1 !', 'Début de la saison 1', 'Gagnez des récompenses dans les donjons mythiques et le nouveau champ de bataille Blitz !', 'Palais des Nérub\’ar', 'Attaquez le siège du pouvoir de la reine Ansurek à Azj-Kahet.', 'Tanière de Zekvir', 'Progressez dans le nouveau contenu de Gouffre saisonnier pour débloquer la tanière de Zekvir.', 63906),
(72, 'frFR', 'Nouveautés dans The War Within !', 'Gouffres', 'Explorez des Gouffres, élucidez des mystères et cherchez des trésors.', 'Talents héroïques', 'Développez votre identité de classe et personnalisez votre configuration de talents !', 'The War Within', 'Voyagez en Khaz Algar et répondez à l\’appel du chant radieux !', 63906),
(71, 'frFR', 'Nouveautés du pré-lancement de The War Within !', 'Des échos radieux', 'Terrassez des adversaires du passé d\’Azeroth dont les souvenirs remontent à la surface. Disponible le 31 juillet !', 'Bientôt disponible : The War Within', 'Lancement le 26 août (accès anticipé le 22 août).', 'Bataillons', 'Vos personnages partagent un accès à une banque de bataillon, aux réputations de Dragonflight et plus !', 63906),
(70, 'frFR', 'Nouveautés de la version 10.2.7', 'Héritage draeneï et troll', 'Récupérez des ensembles d\’armure différents en découvrant leur histoire et leur culture.', 'Pandaria Remixed', 'Un nouvelle manière déjantée de progresser, dès la semaine prochaine !', 'Messager des ténèbres', 'Alors que les îles aux Dragons retrouvent la paix, une terrible menace se prépare.', 63906),
(69, 'frFR', '10.2.7 Mists of Pandaria: Remix', 'Gagnez des récompenses de compte', 'Collectez du bronze pour gagner des montures, mascottes et apparences !', 'Commencer', 'Créez un nouveau personnage du Cours du temps à l\’écran de sélection de personnage.', 'Mists of Pandaria: Remix', 'Découvrez Mists of Pandaria avec une toute nouvelle subtilité !', 63906),
(68, 'frFR', '', 'Obtenir des récompenses', 'Récoltez du pillage pour gagner des récompenses comme des montures, des mascottes et des transmogrifications !', 'Commencer', 'Pour jouer, déconnectez-vous et choisissez Plunderstorm sur l\’écran de sélection de personnages.', 'Plunderstorm', 'Les pirates s\’affrontent au cours d\’une immense bataille !', 63906),
(64, 'frFR', 'Nouveautés de la saison 4 !', 'Saison 4 de Dragonflight', 'Gagnez de nouvelles récompenses.', 'Progression de donjon mise à jour', 'Modes Héroïque, Mythique et Mythique + repensés, récompenses comprises.', 'Raids éveillés', 'Venez à bout des trois raids de Dragonflight pour obtenir des récompenses améliorées !', 63906),
(63, 'frFR', 'Nouveautés de la version 10.2.5 !', 'Archives d\’Azeroth', 'Plongez dans l\’histoire et les légendes des îles aux Dragons.', 'Donjons avec sujets', 'Avec vos sujets, rejoignez la file d\’attente des donjons de World of Warcraft: Dragonflight !', 'Gilnéas reconquise', 'Accompagnez Genn Grisetête et les Gilnéennes et Gilnéens dans la reconquête de leur territoire.', 63906),
(61, 'frFR', 'Nouveautés de la mise à jour 10.2.0 !', 'Gardiens du Rêve', 'Rejoignez la défense du Rêve avec une nouvelle faction de renom, des évènements et des récompenses.', 'Champ de bataille Blitz', 'Rejoignez une expérience de file d\’attente de Champ de bataille 8c8 en solo. Dans ce mode, tout va très vite !', 'Le Rêve d\’émeraude', 'Entrez dans le Rêve et défendez le jeune Arbre-Monde Amirdrassil contre Fyrakka et les druides de la Flamme.', 63906),
(60, 'frFR', 'Nouveautés de la mise à jour 10.1.7 !', 'Armure ancestrale des Réprouvés et des Elfes de la nuit', 'Récupérez des ensembles d\’armure différents en découvrant l\’histoire et la culture de ces races.', 'Découvrez le système des pings', 'Rendez-vous dans le menu des options pour communiquer plus rapidement avec les pings.', 'Poussées oniriques', 'Affrontez des ennemis renforcés par le Rêve dans toutes les îles aux Dragons tandis qu\’Amirdrassil se prépare à éclore !', 63906),
(59, 'frFR', 'Nouveautés de la mise à jour 10.1.5 !', 'Augmentation débloquée', 'Une nouvelle spécialisation de dégâts avec un style de jeu de soutien unique !', 'Voies temporelles délitées', 'Soutenez le Vol draconique de bronze dans les marges des Éons et les failles temporelles !', 'Aube de l\’Infini', 'Affrontez le Vol draconique infini dans un méga donjon mythique !', 63906),
(58, 'frFR', 'Nouveautés de la saison 2 !', 'Saison 2 de Dragonflight', 'Obtenez de nouvelles récompenses en donjons de clé mythique et en JcJ', 'Renouvellement mythique +', 'Découvrez de nouveaux affixes et un choix renouvelé de donjons en mode mythique + !', 'Aberrus, le creuset de l\’Ombre', 'Poursuivez Sarkareth et explorez l\’héritage de Neltharion dans cet ancien laboratoire.', 63906),
(57, 'frFR', 'Nouveautés de la mise à jour 10.1.0 !', 'Glissedrake méandrique', 'Sillonnez la grotte de Zaralek sur la nouvelle monture draconique de la zone !', 'Guildes interfactions', 'Pour la toute première fois de l\’histoire, des joueurs et joueuses de l\’Alliance et de la Horde peuvent unir leurs efforts au sein de la même guilde !', 'Grotte de Zaralek', 'Poursuivez l\’histoire de la Flamme fracturée et affrontez les troupes des Incarnations dans cette étendue souterraine oubliée.', 63906),
(56, 'frFR', 'Nouveautés de la version 10.0.7 !', 'Héritage orc et humain', 'Récupérez des ensembles d\’armure différents en découvrant l\’histoire et la culture de ces races.', 'Mise à jour de l\’offre de parrainage', 'Recevez de nouvelles récompenses extraordinaires en invitant vos proches sur Azeroth !', 'Retour dans les confins Interdits', 'Plongez dans les mystères abandonnés par les Dracthyrs lors de leur fuite.', 63906),
(55, 'frFR', 'Nouveautés de la mise à jour 10.0.5 !', 'La Fureur de l\’orage', 'Affrontez les Primalistes dans l\’avenir des Primalistes pour obtenir des récompenses épiques.', 'Mises à jour des transmogrifications', 'Les objets gris et blancs peuvent désormais être récupérés pour des transmogrifications !', 'Comptoirs ouverts !', 'De nouvelles boutiques proposant des options d\’apparence sont ouvertes à Hurlevent et Orgrimmar.', 63906),
(50, 'frFR', 'Nouveautés de la saison 1 !', 'Saison 1 de JcJ', 'Obtenez des récompenses avec le nouveau mode Brassage solo coté.', 'Saison 1 mythique +', 'Une nouvelle liste de donjons et l\’affixe Foudroiement vous attendent.', 'Caveau des Incarnations', 'Empêchez les Primalistes de libérer les frères et la sœur emprisonnés de Raszageth.', 63906),
(49, 'frFR', 'Nouveautés de Dragonflight !', 'Mise à jour des métiers', 'Nouvelles fonctionnalités en approche : commandes d\’artisanat, équipement, spécialisations et bien plus encore !', 'Vol à dos de Dragon', 'Sillonnez les cieux des îles aux Dragons grâce à un nouveau système de déplacement envoûtant !', 'Îles aux Dragons', 'Gagnez le foyer ancestral des Vols draconiques et aidez-les à retrouver leur grandeur perdue.', 63906);
